import {Component, OnInit, ViewEncapsulation} from '@angular/core';
import {
  AbstractControl,
  FormBuilder,
  FormGroup,
  ValidationErrors,
  Validators,
} from '@angular/forms';
import {HttpClient, HttpHeaders} from "@angular/common/http";
import {DatePipe} from "@angular/common";

const validateMatchedControlsValue = (
  firstControlName: string,
  secondControlName: string
) => {
  return function (formGroup: FormGroup): ValidationErrors | null {
    const { value: firstControlValue } = formGroup.get(
      firstControlName
    ) as AbstractControl;
    const { value: secondControlValue } = formGroup.get(
      secondControlName
    ) as AbstractControl;
    return firstControlValue === secondControlValue
      ? null
      : {
          valueNotMatch: {
            firstControlValue,
            secondControlValue,
          },
        };
  };
};
@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss'],
  providers: [],
})
export class RegisterComponent implements OnInit {
  hide = true;
  PASSWORD_PATTERN = /^(?=.*[!@#$%^&*]+)[a-z0-9!@#$%^&*]{6,32}$/;
  avatarUrl!: string ;
  convertBase64ToUrl(data : string){
// Decode the Base64 data
    const decodedData = atob(data);

// Convert the decoded data to a binary string
    let binaryString = '';
    for (let i = 0; i < decodedData.length; i++) {
      binaryString += String.fromCharCode(decodedData.charCodeAt(i) & 0xff);
    }

// Create a Blob object from the binary string
    const blob = new Blob([binaryString], { type: 'image/jpeg' });

// Create a URL for the blob object
    const imageUrl = URL.createObjectURL(blob);

// Use the image URL to display the image
    this.avatarUrl = imageUrl;

  }

  genders: any[] = [
    {value: 'Male', viewValue: 'Male'},
    {value: 'Female', viewValue: 'Female'},
    {value: 'Other', viewValue: 'Other'},
  ];
  registerForm!: FormGroup;
  constructor(private fb: FormBuilder,private http:HttpClient,private datePipe: DatePipe) {}
  submit(){
    const value  = this.registerForm.getRawValue();
    const requestBody = {
      ...value,
      role:1,
      dob:this.datePipe.transform(this.registerForm.getRawValue().dob , 'yyyy/MM/dd'),
      image:this.avatarUrl,
    };
    const headers = new HttpHeaders()
      .set('Content-Type', 'application/json');
    this.http.post("http://localhost:9999/api/create-user", requestBody).subscribe(
      (response) => {
        // Handle the response
        console.log(response);
      },
      (error) => {
        // Handle the error
        console.error(error);
      }
    );
  }
  getUrl(e: any) {
    const file: File = e.target.files[0];
    const reader = new FileReader();
    reader.onloadend = () => {
      const base64data = reader.result;
      this.avatarUrl = base64data as string;
      console.log(this.avatarUrl)
    };
    reader.readAsDataURL(file);
  }

  ngOnInit(): void {
    this.convertBase64ToUrl("")
    this.registerForm = this.fb.group(
      {
        firstName: ['', Validators.compose([Validators.required])],
        lastName: ['', Validators.compose([Validators.required])],
        profileName: ['', Validators.compose([Validators.required])],
        email: ['', Validators.compose([Validators.required])],
        gender: ['', Validators.compose([Validators.required])],
        id: ['', Validators.compose([Validators.required])],
        dob: ['', Validators.compose([Validators.required])],
        image: ['', Validators.compose([Validators.required])],
        password: [
          '',
          Validators.compose([
            Validators.required,
            Validators.minLength(6),
          ]),
        ],
        confirmPassword: [
          '',
          Validators.compose([
            Validators.required,
            Validators.minLength(6),
          ]),
        ],
      },
      {
        validators: validateMatchedControlsValue('password', 'confirmPassword'),
      }
    );
  }
}
